\"id_menu\":14,\"tx_descripcion\":\"Carga de la datos b\\u00e1sicos del empleado as\\u00ed como la ubicaci\\u00f3n.  Cada vez que se genera un empleado se genera un usuario con perfil secretaria.\",\"tx_color\":\"deep-orange\",\"nu_orden\":5,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"El correo es obligatorio ya que es usado para creaci\\u00f3n del usuario y envi\\u00f3 de las notificaciones.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":14,\"nb_menu\":\"Empleados\",\"tx_icono\":\"mdi-badge-account\",\"tx_ruta\":\"empleado\"}},{\"id\":7,\"nb_asistente\":\"Estructura\",\"id_menu\":12,\"tx_descripcion\":\"Se configura los edificios y\\/o sectores de la instituci\\u00f3n de forma jer\\u00e1rquica, donde se ubican las aulas de clase.\",\"tx_color\":\"deep-orange\",\"nu_orden\":6,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Permite al personal administrativo-docente-alumno ubicar facilmete las aulas, se emplea en horarios y asignaciones de aulas\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":12,\"nb_menu\":\"Estructura\",\"tx_icono\":\"mdi-floor-plan\",\"tx_ruta\":\"estructura\"}},{\"id\":8,\"nb_asistente\":\"Aulas\",\"id_menu\":13,\"tx_descripcion\":\"Se indica las aulas, laboratorios, talleres u otras instalaciones  donde se imparten clases seg\\u00fan la estructura del edificio.\",\"tx_color\":\"deep-orange\",\"nu_orden\":7,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Permite la asignaci\\u00f3n de clase y los horarios. Permite la f\\u00e1cil ubicaci\\u00f3n ya que describe en que estructura de la Instituci\\u00f3n se encuentra ubicada\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":13,\"nb_menu\":\"Aulas\",\"tx_icono\":\"mdi-chair-school\",\"tx_ruta\":\"aula\"}},{\"id\":9,\"nb_asistente\":\"Calendario\",\"id_menu\":15,\"tx_descripcion\":\"Permite crear, editar, activar\\/desactivar el calendario de clases.\",\"tx_color\":\"teal\",\"nu_orden\":8,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Solo puede haber un calendario activo, esto limita las fechas asignable en todas las actividades. Asimismo, muestra solo los grupos creados para ese calendario\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":15,\"nb_menu\":\"Calendario\",\"tx_icono\":\"mdi-calendar-blank\",\"tx_ruta\":\"calendario\"}},{\"id\":10,\"nb_asistente\":\"Periodos\",\"id_menu\":16,\"tx_descripcion\":\"Permite administrar los periodos o lapsos en que se divide al calendario escolar.\",\"tx_color\":\"teal\",\"nu_orden\":9,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Solo puede haber un periodo activo. afecta las actividades y planes de evaluaciones que pueden cargarse\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":16,\"nb_menu\":\"Periodos\",\"tx_icono\":\"mdi-calendar-weekend\",\"tx_ruta\":\"periodo\"}},{\"id\":11,\"nb_asistente\":\"Turnos\",\"id_menu\":21,\"tx_descripcion\":\"Definici\\u00f3n de los diferentes turnos con que trabaja la instituci\\u00f3n\",\"tx_color\":\"teal\",\"nu_orden\":10,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Afecta la informaci\\u00f3n de reportes y horario de clases\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":21,\"nb_menu\":\"Turnos\",\"tx_icono\":\"mdi-timelapse\",\"tx_ruta\":\"turno\"}},{\"id\":12,\"nb_asistente\":\"Horas Academicas\",\"id_menu\":22,\"tx_descripcion\":\"Define las horas de clases y de receso y la carga horaria (horas de clase)\",\"tx_color\":\"teal\",\"nu_orden\":11,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Afecta los horarios de clase\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":22,\"nb_menu\":\"Horas Academicas\",\"tx_icono\":\"mdi-clock\",\"tx_ruta\":\"hora-academica\"}},{\"id\":19,\"nb_asistente\":\"Docente\",\"id_menu\":37,\"tx_descripcion\":\"Informaci\\u00f3n de los docentes con que cuenta la Instituci\\u00f3n. \\n- Permite cargar la foto del mismo. \\n- Se asignan las materias que impartir\\u00e1 el docente\",\"tx_color\":\"teal\",\"nu_orden\":12,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Las materia asignadas permiten su asignaci\\u00f3n al plan de evaluaci\\u00f3n y en consecuencia al grupo.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":37,\"nb_menu\":\"Docente\",\"tx_icono\":\"mdi-account-tie\",\"tx_ruta\":\"docente\"}},{\"id\":14,\"nb_asistente\":\"Areas de Estudio\",\"id_menu\":27,\"tx_descripcion\":\"Departamentos o grupos de materias con que cuenta la instituci\\u00f3n\",\"tx_color\":\"cyan\",\"nu_orden\":13,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Se define los colores que ser\\u00e1n los que identifiquen en Virtualin a la materias asignadas.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":27,\"nb_menu\":\"Areas de Estudio\",\"tx_icono\":\"mdi-file-cad\",\"tx_ruta\":\"area-estudio\"}},{\"id\":15,\"nb_asistente\":\"Materias\",\"id_menu\":28,\"tx_descripcion\":\"Se definen  las materia que se imparten en la instituci\\u00f3n. Agrupadas por Area de Estudio.\",\"tx_color\":\"cyan\",\"nu_orden\":14,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Para los libros con que cuenta el sistema debe existir la materia para el mismo.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":28,\"nb_menu\":\"Materias\",\"tx_icono\":\"mdi-bookshelf\",\"tx_ruta\":\"materia\"}},{\"id\":16,\"nb_asistente\":\"Niveles\",\"id_menu\":24,\"tx_descripcion\":\"Define los Niveles educativos que la instituci\\u00f3n maneja\",\"tx_color\":\"cyan\",\"nu_orden\":15,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Requerido para la creaci\\u00f3n de los Grados\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":24,\"nb_menu\":\"Niveles\",\"tx_icono\":\"mdi-stairs-up\",\"tx_ruta\":\"nivel\"}},{\"id\":17,\"nb_asistente\":\"Grados\",\"id_menu\":25,\"tx_descripcion\":\"Define los grados que maneja la institucion\",\"tx_color\":\"cyan\",\"nu_orden\":16,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Descripcion de la funcionalidad, observaciones y advertencias\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":25,\"nb_menu\":\"Grados\",\"tx_icono\":\"mdi-numeric\",\"tx_ruta\":\"grado\"}},{\"id\":18,\"nb_asistente\":\"Grupos\",\"id_menu\":26,\"tx_descripcion\":\"Descripcion de la tarea de especial cuidado para el funcionamiento del sistema\'\",\"tx_color\":\"cyan\",\"nu_orden\":17,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Descripcion de la funcionalidad, observaciones y advertencias\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":26,\"nb_menu\":\"Grupos\",\"tx_icono\":\"mdi-alphabetical-variant\",\"tx_ruta\":\"grupo\"}},{\"id\":21,\"nb_asistente\":\"Plan Evaluacion\",\"id_menu\":35,\"tx_descripcion\":\"Asignaci\\u00f3n del docente y la activaci\\u00f3n del Plan Evaluaci\\u00f3n seg\\u00fan el Periodo y Materia. Permite carga del Plan de evaluaci\\u00f3n si existe imposibilidad por parte del docente.\",\"tx_color\":\"purple\",\"nu_orden\":18,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Los estudiantes solo podr\\u00e1n ver las actividades de los planes de evaluaci\\u00f3n activos. La responsabilidad de la carga del Plan de Evaluaci\\u00f3n es del docente el cual poseer\\u00e1 un modulo en su bandeja para tal fin.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":35,\"nb_menu\":\"Plan Evaluacion\",\"tx_icono\":\"mdi-table-clock\",\"tx_ruta\":\"plan-evaluacion\"}},{\"id\":22,\"nb_asistente\":\"Horario\",\"id_menu\":36,\"tx_descripcion\":\"Se definen los horarios de clase de los Grupos de alumnos, aqu\\u00ed se asigna la hora, d\\u00eda, materia, docente y aula de cada clase.\",\"tx_color\":\"purple\",\"nu_orden\":19,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"El sistema valida la disponibilidad del docente y del aula de clases. los alumnos y docentes ver\\u00e1n reflejado dicho horario en su bandeja.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":36,\"nb_menu\":\"Horario\",\"tx_icono\":\"mdi-calendar-multiselect\",\"tx_ruta\":\"horario\"}},{\"id\":24,\"nb_asistente\":\"Nivel Calificaciones\",\"id_menu\":31,\"tx_descripcion\":\"Define los niveles de juicio valorativo de las calificaciones\",\"tx_color\":\"purple\",\"nu_orden\":20,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Ejemplo: Desempe\\u00f1o Bajo,  Desempe\\u00f1o Superior, etc.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":31,\"nb_menu\":\"Nivel Calificaciones\",\"tx_icono\":\"mdi-check-box-multiple-outline\",\"tx_ruta\":\"nivel-calificacion\"}},{\"id\":25,\"nb_asistente\":\"Calificacion\",\"id_menu\":32,\"tx_descripcion\":\"Definici\\u00f3n de los grupos de calificaciones para cada nivel educativo. Asimismo, se definen los rangos de notas, el nivel, letra y aprobaci\\u00f3n de la calificaci\\u00f3n.\",\"tx_color\":\"purple\",\"nu_orden\":21,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Debe respetar el orden de los rangos para evitar errores del calculo.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":32,\"nb_menu\":\"Calificacion\",\"tx_icono\":\"mdi-check-box-outline\",\"tx_ruta\":\"calificacion\"}},{\"id\":29,\"nb_asistente\":\"Feriados\",\"id_menu\":17,\"tx_descripcion\":\"Definici\\u00f3n de los d\\u00edas feriados que puedan afectar  las Clases\",\"tx_color\":\"purple\",\"nu_orden\":22,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Los feriados fijos no se comprobara el a\\u00f1o, al contrario que los variables que requieren carga anual donde se indique el a\\u00f1o\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":17,\"nb_menu\":\"Feriados\",\"tx_icono\":\"mdi-calendar-star\",\"tx_ruta\":\"feriado\"}},{\"id\":30,\"nb_asistente\":\"Tipo Agenda\",\"id_menu\":18,\"tx_descripcion\":\"Definici\\u00f3n de los diferente grupos de asignaci\\u00f3n para la agendas de Actividades.\",\"tx_color\":\"purple\",\"nu_orden\":23,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\".\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":18,\"nb_menu\":\"Tipo Agenda\",\"tx_icono\":\"mdi-clipboard-text-multiple\",\"tx_ruta\":\"tipo-agenda\"}},{\"id\":31,\"nb_asistente\":\"Tipo Actividad\",\"id_menu\":19,\"tx_descripcion\":\"Definici\\u00f3n de los tipos de actividades que se podr\\u00e1n cargar la agenda\",\"tx_color\":\"purple\",\"nu_orden\":24,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Los tipo de actividades se identificaran con un icono y color en los calendarios.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":19,\"nb_menu\":\"Tipo Actividad\",\"tx_icono\":\"mdi-clipboard-text-multiple\",\"tx_ruta\":\"tipo-actividad\"}},{\"id\":32,\"nb_asistente\":\"Agenda\",\"id_menu\":20,\"tx_descripcion\":\"Se asignan las actividades anuales seg\\u00fan el grupo y el tipo de actividad.\",\"tx_color\":\"purple\",\"nu_orden\":25,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"La asignaci\\u00f3n de la actividad env\\u00eda una notificaci\\u00f3n al grupo asignado.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":20,\"nb_menu\":\"Agenda\",\"tx_icono\":\"mdi-clipboard-text\",\"tx_ruta\":\"agenda\"}},{\"id\":26,\"nb_asistente\":\"Condicion Alumno\",\"id_menu\":38,\"tx_descripcion\":\"Definici\\u00f3n de las condiciones en que el alumno esta inscrito en la instituci\\u00f3n.\",\"tx_color\":\"pink\",\"nu_orden\":26,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\".\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":38,\"nb_menu\":\"Condicion Alumno\",\"tx_icono\":\"mdi-school-outline\",\"tx_ruta\":\"tipo-condicion\"}},{\"id\":27,\"nb_asistente\":\"Alumnos\",\"id_menu\":39,\"tx_descripcion\":\"Permite la carga de los datos generales del alumno,  foto, inscripci\\u00f3n, asignaci\\u00f3n de materias acudientes y faltas y sanciones.\",\"tx_color\":\"pink\",\"nu_orden\":27,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"- la asignaci\\u00f3n de materia sera de forma autom\\u00e1tica si el grupo ya posee materias asignadas de lo contrario debera asignase mediante esta pantalla ya sea asignaci\\u00f3n de materia al alumno o asignaci\\u00f3n por el grupo.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":39,\"nb_menu\":\"Alumnos\",\"tx_icono\":\"mdi-school\",\"tx_ruta\":\"alumno\"}},{\"id\":28,\"nb_asistente\":\"Acudiente\",\"id_menu\":40,\"tx_descripcion\":\"Definici\\u00f3n de los datos de los acudientes, foto y alumnos a los cuales representa.\",\"tx_color\":\"pink\",\"nu_orden\":28,\"tx_grupo\":\"secretaria\",\"tx_observaciones\":\"Se debe tener especial cuidado con el correo ya que se crear de forma autom\\u00e1tica el usuario.\\nLa asignacion del alumno puede realizar igualmente desde el modulo de alumnos.\",\"id_status\":1,\"id_usuario\":1,\"menu\":{\"id\":40,\"nb_menu\":\"Acudiente\",\"tx_icono\":\"mdi-human-male-child\",\"tx_ruta\":\"pariente\"}}],\"duration\":811,\"memory\":4,\"hostname\":\"lyustiz-PC\"}', '2021-01-23 23:28:38');
